    "contents": [
        {
            "heading": "mcp-server-介绍",
            "content": "MCP 协议（Model Context Protocol），是由 Anthropic 在 2024年 11 月初发布的协议。它的目的在于统一 AI 模型与外部系统之间的通信方式，从而简化 AI 模型与外部系统之间的通信问题。随着 OpenAI 官宣支持 MCP 协议，越来越多的 AI 厂商开始支持 MCP 协议。"
        },
        {
            "heading": "mcp-server-介绍",
            "content": "MCP 协议主要包含 Client 和 Server 两部分。简单来说，Client 是使用 AI 模型的一方，它通过 MCP Client 可以给模型提供一些调用外部系统的能能力；Server 是提供外部系统调用的一方，也就是实际运行外部系统的一方。"
        },
        {
            "heading": "mcp-server-介绍",
            "content": "FastGPT MCP Server 功能允许你选择多个在 FastGPT 上构建好的应用，以 MCP 协议对外提供调用 FastGPT 应用的能力。"
        },
        {
            "heading": "mcp-server-介绍",
            "content": "目前 FastGPT 提供的 MCP server 为 SSE 通信协议，未来将会替换成 HTTP streamable。"
        },
        {
            "heading": "1-创建-mcp-server",
            "content": "登录 FastGPT 后，打开工作台，点击MCP server，即可进入管理页面，这里可以看到你创建的所有 MCP server，以及他们管理的应用数量。"
        },
        {
            "heading": "1-创建-mcp-server",
            "content": "可以自定义 MCP server 名称和选择关联的应用"
        },
        {
            "heading": "2-获取-mcp-server-地址",
            "content": "创建好 MCP server 后，可以直接点击开始使用，即可获取 MCP server 访问地址。"
        },
        {
            "heading": "3-使用-mcp-server",
            "content": "可以在支持 MCP 协议的客户端使用这些地址，来调用 FastGPT 应用，例如：Cursor、Cherry Studio。下面以 Cursor 为例，介绍如何使用 MCP server。"
        },
        {
            "heading": "3-使用-mcp-server",
            "content": "打开 Cursor 配置页面，点击 MCP 即可进入 MCP 配置页面，可以点击新建 MCP server 按钮，会跳转到一个 JSON 配置文件，将第二步的接入脚本复制到json 文件中，保存文件。"
        },
        {
            "heading": "3-使用-mcp-server",
            "content": "此时返回 Cursor 的 MCP 管理页面，即可看到你创建的 MCP server，记得设成enabled状态。"
        },
        {
            "heading": "3-使用-mcp-server",
            "content": "打开 Cursor 的对话框，切换成Agent模型，只有这个模型，cursor 才会调用 MCP server。发送一个关于fastgpt的问题后，可以看到，cursor 调用了一个 MCP 工具（描述为：查询 fastgpt 知识库），也就是调用 FastGPT 应用去进行处理该问题，并返回了结果。"
        },
        {
            "heading": "私有化部署-mcp-server-问题",
            "content": "私有化部署版本的 FastGPT，需要升级到v4.9.6及以上版本才可使用 MCP server 功能。"
        },
        {
            "heading": "修改-docker-composeyml-文件",
            "content": "在docker-compose.yml文件中，加入fastgpt-mcp-server服务:"
        },
        {
            "heading": "修改-fastgpt-容器环境变量",
            "content": "修改config.json配置文件，增加: \"feconfigs.mcpServerProxyEndpoint\": \"fastgpt-mcp-server 的访问地址\"， 末尾不要携带/，例如:"
        },
        {
            "heading": "重启-fastgpt-容器",
            "content": "因为是修改的挂载文件，可以强制 down 再 up 服务。启动后，既可以在工作台看到 MCP server 服务选项。"
        }
    ],
